import satelite from '../src/img/satelite.jpg'
import planet from '../src/img/planet.jpg'
import './Home_component.css'

function Home_component() {
    return (
      <div className="Home_component">  
        <div className="Home_component_header">
        
            <div>

              <div className="satelite spin_right">
                  <img src = {satelite}></img>
                  </div>
              <div className='planet spin_'>
                  <img src = {planet}></img>
              </div>


            </div>
            
        </div>
      </div>
    );
  }
  export default Home_component;
